INSERT INTO `tb_input_pertanyaan` VALUES (1,'Informasi','mohon info untuk nst an mawar erfina bagaimana?',2,159),(2,'Saran','Assalamu\'ailaikum Wr.Wb\r\nBapak/ Ibu mohon support untuk kendala jika tgl lahir berbeda dengan NIK,\r\ndi email sudah tetapi belum ada hasil untuk bisa di infut.\r\nTerimakasih Mohon Support',2,157),(3,'Informasi','Assalamualaikum\r\nmohon support untuk perubahan helpdesk dta cms mohon maaf saya salah infut untuk konsumen sumiati harusnya cms wawan indriana \r\nini kesalahan infut masuk ke cms mohamad reza.\r\nTerimakasih\r\n',2,157);

